import { Button } from 'bootstrap';
import React from 'react';
import { Jumbotron } from 'reactstrap';

const Home=()=>{
    return(
        <div>
            <Jumbotron className="text-center">
            <h2 className="display-3">Wellcome To SOUMYA World</h2>
               <p>Here you can learn React,SpringBoot with ths my simple project.</p>
              <Button color="success" outline>Learn basic of React</Button>
            </Jumbotron>
        </div>
    )
}
export default Home ;
